import React, { useEffect } from "react";

function WebGazer() {
  useEffect(()=>{
    const webgazer = window.webgazer
    webgazer.setGazeListener((data, clock) => {
      console.log(data, clock);
    }).begin();
  }, [])

  return(
      <div></div>
  );
};

export default WebGazer;
